import React from 'react';
import { useState, useEffect } from 'react';
import { Component } from 'react';
import './ApiPulls.css';

class App extends Component {
    state = {
      todos: []

    }
    componentDidMount() {
      fetch('https://developer.nps.gov/api/v1/parks?parkCode=acad&api_key=8NnStekoxJFhJSQlXFrZ4RmXW7ebm6OvQA4upeaF')
      .then(res => res.json())
      .then((data) => {
        this.setState({ todos: data['data'][0]})
        var name_list = [];
        for(let i = 0; i < this.state.todos["activities"].length; i++)
        {
          name_list[i] = this.state.todos["activities"][i]["name"];
          console.log(name_list)
        }
        return name_list;
      })
      .catch(console.log)
    }


  render(){
    return (
    <div>
        <div className = "NatParkData">
            <h1>{JSON.stringify(this.state.todos['fullName'].replace("/",' '))}</h1>
            <p>
            {JSON.stringify(this.state.todos["description"])}
            </p>
            <p> {JSON.stringify(this.state.name_list)}</p>

        </div>
    </div>     
  );
}
}
export default App
